        axios.get(url,{headers:headers})
        .then((response)=>{
            setAlbums(response.data.albums)
        })
        .catch((err)=>console.log(err.message))


    }

    useEffect(()=>{
        fetchAlbums()
    },[])

  return (
    <div className="d-flex justify-content-center align-items-center" style={{height:'100vh'}} >
      <AlbumList allAlbums={albums}/>
    </div>
  );
}

export default App;
